For a more formal definition of <span class="mathquill">L(v)</span> and <span class="mathquill">H(v)</span>:

Let <span class="mathquill">S(v)</span> be the set of all nodes reachable from <span class="mathquill">v</span> on green edges plus one red edge.

<span class="mathquill">S(v)=</span>{
<span class="mathquill">w | v \rightarrow w</span>}
<span class="mathquill">\cup</span>{
<span class="mathquill">w|\exists u\text{ s.t } v \rightarrow u \text{ and }u \hookrightarrow w </span>}

where <span class="mathquill">\rightarrow</span> indicates there is a path from <span class="mathquill">u</span> to <span class="mathquill">w</span> following green edges and  <span class="mathquill">\hookrightarrow</span> denotes a red edge between <span class="mathquill">u</span> and <span class="mathquill">w</span>.

Then <span class="mathquill">L(v) = \text{minimum}(S(v))</span> and 
 <span class="mathquill">H(v) = \text{maximum}(S(v))</span>
